import React from 'react'
import { View, Text, StyleSheet } from 'react-native'

// Import Configs
import colors from '../../config/colors'

// Import Components
import Screen from '../../components/Screen'

// Import Libraries
import { FontAwesome } from '@expo/vector-icons'

const Dashboard = () => {
  return (
    <Screen>
      <View style={styles.container}>
        <View style={styles.studentsBlock}>
          <FontAwesome name='users' size={48} color='white' />
          <View style={styles.blockText}>
            <Text style={styles.heading}>Registered Students</Text>
            <Text style={styles.count}>100</Text>
          </View>
        </View>
        <View style={styles.companyBlock}>
          <FontAwesome name='building-o' size={48} color='white' />
          <View style={styles.blockText}>
            <Text style={styles.heading}>Registered Companies</Text>
            <Text style={styles.count}>30</Text>
          </View>
        </View>
        <View></View>
      </View>
    </Screen>
  )
}

const styles = StyleSheet.create({
  container: {
    padding: 10,
  },
  studentsBlock: {
    padding: 20,
    backgroundColor: colors.light,
    marginBottom: 10,
    display: 'flex',
    flexDirection: 'row',
    alignItems: 'center',
    borderRadius: 3,
  },
  companyBlock: {
    padding: 20,
    backgroundColor: colors.medium,
    marginBottom: 5,
    display: 'flex',
    flexDirection: 'row',
    alignItems: 'center',
    borderRadius: 3,
  },
  jobsBlock: {
    padding: 20,
    backgroundColor: colors.primary,
    marginBottom: 5,
    display: 'flex',
    flexDirection: 'row',
    alignItems: 'center',
    borderRadius: 3,
  },
  blockText: {
    marginLeft: 15,
  },
  heading: {
    fontSize: 14,
    color: colors.white,
  },
  count: {
    fontSize: 20,
    fontWeight: 'bold',
    color: colors.white,
  },
})

export default Dashboard
